import com.eviware.soapui.support.XmlHolder
import com.eviware.soapui.impl.wsdl.testcase.WsdlTestRunContext

 def ProcessAgeNotice = testRunner.testCase.testSuite.testCases["ProcessAgeNotice"].testSteps["processAgeNotice"].getPropertyValue("Request")

 def CourtRoomCode=testRunner.testCase.testSuite.testCases["ProcessAgeNotice"].getPropertyValue("CourtRoomCode")

 def xmlAdd= new XmlHolder(ProcessAgeNotice)
 xmlAdd.setNodeValue("//ccd:processAgeNotice/AgeNotice/CourtRoomCode",CourtRoomCode)

 def newxmlGet= xmlAdd.getXml();
 //add xml detail
 testRunner.testCase.testSuite.testCases["ProcessAgeNotice"].testSteps["processAgeNotice"].setPropertyValue("Request",newxmlGet)

 def getTestStep=testRunner.testCase.testSuite.testCases["ProcessAgeNotice"].testSteps["processAgeNotice"]
 def contextProcessAgeNotice = new WsdlTestRunContext(getTestStep);
 getTestStep.run(testRunner,contextProcessAgeNotice)
 //Validation -
 def getRes=testRunner.testCase.testSuite.testCases["ProcessAgeNotice"].testSteps["processAgeNotice"].getPropertyValue("Response")
def Response= new XmlHolder(getRes)
def GetResponse= Response.getNodeValue("//status")

log.info GetResponse

assert GetResponse=="1"

